import React from 'react';

function App() {
  return (
    <div className="App flex justify-center items-center">
			<Login />
    </div>
  );
}

const Login = () => {
	return (
		<div className="bg-blue-400 m-auto w-9/12 rounded-lg p-10 text-center">
			<p className="text-xl"><b>High School Management System</b></p>
			<form className="flex flex-col justify-center items-center">
				<label className="flex flex-col m-3 text-left w-full">
					Email:
					<input type="text" />
				</label>
				<label className="flex flex-col m-3 text-left w-full">
					Password:
					<input type="password" />
				</label>
			</form>
		</div>
	);
}

export default App;
